import "./ExpenselItem.css";
 import Expendelitem from "./Expenselitem.js";
function Expense(data){
  console.log(data);
  return(
    <div className='app'>
      <Expendelitem 
        title={data[0].title} 
        amount={data[0].amount} 
        data={data[0].data}></Expendelitem>
      <Expendelitem
        title={data[1].title} 
        amount={data[1].amount} 
        data={data[1].data}></Expendelitem>
      <Expendelitem
        title={data[2].title} 
        amount={data[2].amount} 
        data={data[2].data}></Expendelitem>
      <Expendelitem
        title={data[3].title} 
        amount={data[3].amount} 
        data={data[3].data}></Expendelitem>
   </div>


  )
}
export default Expense;
